import Pizza from "./Pizza";
import pizzaData from "./data.js";

export default function Menu() {
	const pizzas = pizzaData()

	return (
		<main className="menu">
			<h2>Our menu</h2>

			<ul className="pizzas">
				{pizzaData.map((pizza) => (
					<Pizza key={pizza.name} pizza={pizza} />
				))}
			</ul>
		</main>
	);
}
